C9. &#39;I don&#39;t trust the polls, I have never been polled and nor has my 18 year old daughter!&#39;
<br>
<br>FACTS: Every poll covers about 0.001% of the voting population of America.  So even if everyone had an equal chance of being polled, the average person would be waiting 10000 polls on average between being contacted - or say a few thousand after adjusting for non-responses. There are often about 100 national voting intention polls per year.  Especially if one lives in a boring seat that doesn&#39;t get a lot of seat polls, one might get polled only a few times in one&#39;s voting life, if that.

A2: &quot;polls generally only reach older voters because younger voters do not have landlines or answer mobile phone calls from unknown numbers&quot;
<br>
<br>FACTS: No major regular voting intention pollster exclusively uses phone polling. Most are exclusively online and therefore do not call at all.  Some less prominent polls still use phone polling but phone polling of random numbers is not very accurate anymore because younger voters are so hard to reach and those who are reached tend to be unrepresentative.

